import { MEMBER_CARD } from '@/views/biz-components/h5/pages/member-card.config'
import {
  ADMISSION_RANGE,
  PRICE_SETTING,
  SUPPORT_SALES,
  SELL_STATUS
} from '@/constants/card/member'
import { shop_columns, price_gradient_columns } from './info.config'
