  name: 'BrandPeriodCardInfo',
  bem: {
    item: 'brand-card'
  },
  components: {
    MemberCard,
    H5Container
  },
  serviceInject() {
    return {
      infoService: InfoService
    }
  },
  rxState() {
    return {
      cardInfo: this.infoService.cardInfo$
    }
  },
  data() {
    return {
      ADMISSION_RANGE,
      PRICE_SETTING,
      SUPPORT_SALES,
      SELL_STATUS,
      MEMBER_CARD,
      // 门店表头
      shop_columns,
      // 售卖定价表头
      price_gradient_columns
    }
  }
}
